import React, { useState, useEffect } from "react";
import { fetchGames } from "./api";
import "./LigaChamp.css";

const LigaChamp = () => {
    const [games, setGames] = useState([]);

    useEffect(() => {
        fetchGames().then(data => setGames(data));
    }, []);

    return (
        <div>
            <h2>Champions League Games</h2>
            <ul>
                {games.map((game) => (
                    <li key={game.ID}>
                        {game.HomeTeam} vs {game.AwayTeam} - {game.Score}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default LigaChamp;
